// import logo from './logo.svg';
import "./App.css";
import { useAuth0 } from "@auth0/auth0-react";
function App() {
  const { loginWithPopup, loginWithRedirect, logout, user, isAuthenticated } =
    useAuth0();
  return (
    <div className="App">
      <h1>Yash Varshney</h1>
      <ul>
        <li>
          <button onClick={loginWithPopup}>login With Popup</button>
        </li>
        <li>
          <button onClick={loginWithRedirect}>login With redirec</button>
        </li>
        <li>
          <button onClick={logout}>login With logout</button>
        </li>
      </ul>
      <h3>User is {isAuthenticated ? "logged in " : "not logged in"}</h3>
      {isAuthenticated && (
        <pre style={{ textAlign: "start" }}>
          {JSON.stringify(user, null, 2)}
        </pre>
      )}
      <ul>
        <li><button>Call Api Route</button></li>
        <li><button>Call Protected Api</button></li>
      </ul>
    </div>
  );
}

export default App;
